import React from 'react';

import {StyleSheet, css} from 'aphrodite';
import TextHover from "./TextHover";
const Header = ({
                main = false,
                portfolio = false,
                prices = false,
                reviews=  false,
                contact_us = false,
                }) => {
    const containerRowStyle = StyleSheet.create({
      row: {
          flex: 1,
          "display":"flex",
          flexDirection:"row",
          alignItems: "start"
      },
        spaceWidth: {
          marginLeft: "1.5%",
            marginRight : "1.5%"
        },
        spaceHeight: {
            "margin-bottom" : "5.5%",
        }
    });
    const activatedColor = "";
    const deactivatedColor = "";
    return (
        <div className={css(containerRowStyle.row)}>
            <TextHover text="new text" color="#696871" fontWeight="400"></TextHover>
            <span className={css(containerRowStyle.spaceWidth)}></span>
            <span className={css(containerRowStyle.spaceWidth)}></span>
            <TextHover text="new text" color={main?"":"#696871"} fontWeight="600"></TextHover>
            <span className={css(containerRowStyle.spaceWidth)}></span>
            <TextHover text="new text" color="#696871" fontWeight="600"></TextHover>
            <span className={css(containerRowStyle.spaceWidth)}></span>
            <TextHover text="new text" color="#696871" fontWeight="600"></TextHover>
            <span className={css(containerRowStyle.spaceWidth)}></span>
            <TextHover text="new text" color="#696871" fontWeight="600"></TextHover>
            <div className={css(containerRowStyle.spaceHeight)}></div>
        </div>
    );
};

export default Header;
